(1968325951272116226, 1968324787302424578, 'dragon', 'dargon', 'dragon', '0x901234567834567890abcdef12345678901234567', 'Play to mint', 'è¯¥æ´»åŠ¨æ˜¯æŠ€æœ¯è®¨è®ºï¼Œæ—¨åœ¨ç”¨å„ç§æ–¹å¼æ¥è¿›è¡Œmintï¼Œè¿™æ¬¡è®¨è®ºçš„æ–¹å‘ä¸»è¦æ˜¯play to mintï¼Œç©æ¸¸æˆçš„æ–¹å¼è¿›è¡Œã€‚', 'offline', '2025-10-01 14:30:00', 'æ·±åœ³å®å®‰', '100', 'projects', 'è¾¾æˆå…±è¯†', 'è®¨è®ºã€åƒé¥­ã€å–é…’', '', '', '', 'éœ€è¦5000U', 'éœ€è¦å„æ–¹KOL', 1, NULL, 0, '2025-09-17 14:47:31', '2025-09-18 03:14:04', 0, '412582902@qq.com'),
(1970580295296024578, 1970533870789001217, 'Aguda Believe', '@JustlacyKimberleyRogers', '@khulture_d_mod', '2AquuebhKVvFTNvEDhjVGvpv87qD1eJdiia5aswZb2sc', 'Web3 Unchained: Bridging Crypto and Creativity', 'Imagine a Space where every artist, musician, and writer has the power to truly own their work, connect directly with their audience, and build a sustainable career without intermediaries. This isn\'t a distant dream; it\'s the future we want to build, right here, right now. \"WEB3 Unchained\" is more than an event; it\'s a movement. It\'s a vibrant, hands-on celebration designed to demystify the world of Web3 and place its powerful tools directly into the hands of our city\'s most creative minds. We want to replace confusion with curiosity and barriers with bridges, creating a space where technology feels less like code and more like a canvas for creation.\n', 'hybrid', '2025-10-25 11:00:00', 'Co-creation Hub (CcHUB), 294 Herbert Macaulay Way, Yaba, Lagos, Nigeria. A vibrant and respected nexus for tech and innovation in the heart of Lagos.', '150 in-person attendees & 400+ online viewers.', 'newusers', 'Our goals are deeply human-focused and centered on genuine empowerment:\n1. Spark Genuine Curiosity: To transform the intimidating perception of crypto into an exciting, accessible tool for at least 150 local creators. We want to see the \'aha!\' moment on their faces as they realize what\'s possible.\n2. Empower Through Education: To personally guide 50+ new users through the entire process of setting up a Solana wallet and exploring the FlipFlop platform, ensuring they leave with confidence, not just information.\nBuild a Real Community: To plant the seeds of a lasting FlipFlop creator community in Lagosâ€”a support system that lives on long after the event, connecting, sharing, and growing together.\n3. Showcase, Don\'t Just Tell: To spotlight 3-5 local artists who are already using Web3, providing tangible proof and heartfelt inspiration for what\'s possible when creativity meets technology.\n', 'The event agenda is designed for energy, connection, and hands-on learning, starting with doors opening at 2:00 PM with an Afrobeats DJ and interactive art. At 2:30 PM, a passionate talk will ignite imagination about the future of creativity and ownership. A hands-on workshop at 3:00 PM will guide attendees through creating a wallet and introducing the FlipFlop platform, with community helpers on standby. At 4:00 PM, local Web3 creators will share inspiring stories. A Q&A panel with speakers and a FlipFlop expert will take place at 4:45 PM. From 5:15 PM to 6:00 PM, there will be networking, music, and food. The online experience will include a dedicated host for the livestream, engaging the audience with questions, polls, and giveaways.', 'We\'re not just measuring vibes; we\'re aiming for tangible impact:\nAttendance: 150+ engaged in-person attendees and 400+ unique online viewers.\nOnboarding: 75+ new Solana wallets created during our workshop.\nReach: Over 100,000 impressions on social media through our promotional campaign and the event hashtag #WEB3Unchained.\nMedia Coverage: Features in at least two major Nigerian tech or culture blogs (e.g., TechCabal, BellaNaija).\nCommunity Growth: A new, active Telegram group for Lagos FlipFlop creators with at least 100 members by the end of the event, ready to support each other on their journey', 'We are in initial, hopeful conversations with Niyi Okeowo, a renowned Nigerian digital artist, and The Gidi Creative Centre, a local art incubator, to participate in our Creator Spotlight.\n', 'We plan to partner with AfroTech Hub and the Lagos Art Collective to cross-promote the event and tap into their vibrant, creative communities.\n', 'To bring this vision to life with the energy and quality it deserves, we need your support. Our budget is built on creating an unforgettable experience, not extravagance.\nVenue & Logistics - $2,500: To secure a prime, tech-ready space at CcHUB. This is our foundation for a professional and inspiring atmosphere.\nTech & Streaming - $1,200: For professional audio-visual equipment and a multi-camera setup for a high-quality, engaging livestream. We want our online guests to feel like they\'re in the room with us.\nFood & Beverage - $800: Good food and drinks are the lifeblood of connection! This is for local caterers to provide refreshments that keep the energy and conversations flowing.\nMarketing & Promotion - $500: For targeted social media ads and collaborations with local influencers to ensure we reach every creator who needs to be in the room.\nCreator Showcase Stipend - $500: A small honorarium ($100 each for 5 creators) to value the time and talent of our local speakers. This is about investing back into the community from day one.\nTotal Request: $5,500 USDT\n', 'Beyond finances, a true partnership would be the dream. We would be incredibly grateful for:\nMarketing Amplification: A feature on FlipFlop\'s official Twitter/X and blog to lend us credibility and help us reach a global audience.\nExpert Presence: Having a FlipFlop team member join our Q&A panel remotely would be invaluable, providing direct insight and forging a stronger connection to the brand.\nAwesome Swag: Co-branded T-shirts, stickers, notebooks! It\'s amazing how much a cool piece of merchandise can make people feel like they\'re part of a family.', 1, 'Thank you for your application. Weâ€™ve received your request, and our BD team will reach out to you via email shortly.\nPlease note: approval on the website only confirms that we have received your message. All details and next steps will be discussed directly with our BD team.\n', 0, '2025-09-23 20:05:29', '2025-09-26 07:46:38', 0, 'agudabelieve@gmail.com'),
(1970768269199605762, 1970088649013948418, 'Israel', '@Israel034', '@IsraelDeyForYou', '9zaXtidQuXG7iNLHPeL2953CWwAbRoxPom5h841RDPSA', 'Introducing FlipFlop and it\'s importance in our everyday life ', 'Detailed breakdown of FlipFlop ', 'online', '2025-10-15 09:00:00', 'Abuja Nigeria ', '--', 'newusers', 'Bring in more user to use and explore the importance of FlipFlop ', '4 hours detailed breakdown of FlipFlop ', '200 attendees with video coverage ', '@BestDgem on X \n@Hermesthegreat on X', 'Best era community ', '$500 for overall event', 'Two more organizers ', 2, NULL, 0, '2025-09-24 08:32:25', '2025-09-25 05:35:16', 0, 'sundaysokomba@gmail.com'),
(1970810293118369793, 1970512533773156353, 'Quinn Valentine', '@quinn_valentine', '@quinnvalentine0', '6NGnvAnA4TWaq18GJU8ype3HUbw8GNM5duABoZxFQUN2', 'Community Engagement and web 3 content creation', 'This activity will introduce participants to the Flipflop Footprint platform. Attendees will learn how to earn Footprint points, complete tasks, and engage with the community to maximize rewards. The session includes step-by-step guidance and tips for both new and existing users', 'hybrid', '2025-10-01 20:00:00', 'Online via X, Twitter space and Telegram', 'Medium ( Expected 50 - 100 participants)', 'newusers', 'I aim to Increase awareness of the Flipflop Footprint program\n\nEncourage active participation from new users\n\nAnd also Provide step-by-step guidance to maximize Footprint points and rewards', 'Welcome participants and brief introduction of Flipflop Footprint\n\nExplain baseline and advanced tasks, Footprint points system, and rewards\n\nLive demo: How to submit tasks and track progress\n\nQ&A session for participants\n\nClosing remarks and tips for maximizing monthly rewards', 'Attendance: 50â€“100 participants\n\nSocial reach: 200â€“500 impressions via Twitter/X and Telegram\n\nEngagement: Active participation in Q&A and task submissions\n\nMedia coverage: Screenshots, highlights, and feedback shared with Flipflop team', 'Quinn Valentine (host and moderator)\n\nOptional: A Flipflop representative if available', 'Telegram communities and Web3 KOLs who are active in community education', '50 USDT to cover promotional materials (graphics, posts, and small giveaways)\n\n30 USDT for event incentives to encourage participation (e.g., small prizes for attendees)', 'Assistance in promoting the event on official Flipflop channels\n\nAccess to sample content or guidelines for participants', 1, 'Thank you for your application. Weâ€™ve received your request, and our BD team will reach out to you via email shortly.\nPlease note: approval on the website only confirms that we have received your message. All details and next steps will be discussed directly with our BD team.\n', 0, '2025-09-24 11:19:24', '2025-09-26 07:46:46', 0, 'quinnvalentinebtc@gmail.com'),
(1970819492716019714, 1970816796764209153, 'Joseph Efai ', '@Defai_2', '@Josephefai_1', '7PG4ZcKkVi1yZkUPQmDLNsNeQnUvsmRXw5cQV1ULeXoQ', 'Referral program ', 'I host a referral campaign in my community for flipflop', 'online', '2025-11-09 15:32:00', 'Africa', 'Large ', 'community', 'Referral program ', 'I will create a referral campaign ', '', '', '', 'FlipFlop needs financial support for program expenses (70%), administration (20%), and fundraising (10%). Itemized costs include salaries, rent, utilities, materials, and advertising to fulfill its mission.', 'Creating awareness ', 2, NULL, 0, '2025-09-24 11:55:58', '2025-09-25 05:28:21', 0, 'josephefai@gmail.com'),
(1970871493319499777, 1970031782183137281, 'Trust wallet Africa', '@HenryHart777', '@HenryHart777', '2FTFpk6f1uGEt1pQvY7GCD3T27BKu2JVPhR5VQY6UR9C', 'Explore Blockchain with trust wallet ', 'The event is a Web3 workshop in Lokoja organized by Trust Wallet in collaboration with BlockchainFUL. It is designed to introduce beginners to blockchain, cryptocurrency, and decentralized applications, with practical sessions on wallet security, self-custody, and real-life use cases. As a premium member of BlockchainFUL, I am directly involved in the organizing network for this event, which also provides an avenue to promote Flip flop to a highly relevant audience.', 'offline', '2025-09-27 12:00:00', 'Akk hotel and resort lokoja', 'Local scale (Lokoja city)', 'newusers', 'Through this activity, I hope to create greater visibility for Flip flop, educate new users about its value, and practically demonstrate features like minting to drive awareness, adoption, and community growth.\n', 'At the event, me and my team members will introduce Flip flop to participants in a simple and relatable way, sharing its vision and what makes it unique. From there, Iâ€™ll walk them through a live demonstration of minting so they can see how it works in practice. After that, weâ€™ll have an open Q&A and casual discussions to answer questions and clear doubts. Finally, Iâ€™ll use the opportunity to connect with attendees and invite them to be part of the Flip flop community.\n', 'Expecting 70-100 attendees ', '', 'BlockchainFUL Community ', 'To actively represent Flip flop at the Trust Wallet & BlockchainFUL Web3 Workshop in Lokoja, the following support will be required:\n\n1. Logistics and Transportation â€“ $100\n\nTransportation for me and my team members to and from the event venue.\n\n\n\n2. Community Giveaways for Engagement â€“ $300\n\nSmall incentives to support participants during wallet setup and the minting demonstration, making the session more interactive and impactful.\n\nTotal Estimated Support Required: $400\n\nThis support will ensure full participation, smooth facilitation of the minting demonstration, and meaningful engagement with attendees to onboard them into the Flip flop community.', 'Community Promotion: Amplifying the event on Flip flopâ€™s social media and community channels to drive awareness and participation.', 1, 'Thank you for your application. Weâ€™ve received your request, and our BD team will reach out to you via email shortly.\nPlease note: approval on the website only confirms that we have received your message. All details and next steps will be discussed directly with our BD team.\n', 0, '2025-09-24 15:22:36', '2025-09-26 07:46:54', 0, 'ayokobamise@gmail.com'),
