(1970930776102969346, 1970096984320733186, 'Cryptogist ', '@Cryptogistlover', '@Cryptogistlover', 'Dzu2ppHDXuSbr36HRjHQq4YNFBvfj4B7Lx4TUaprd6M8', 'Engagement the way to drive growth and progress', 'The \nExpected Outcome: Boost in project visibility, stronger community bonding, and increased interest from new audiences.', 'online', '2025-09-23 19:02:00', 'Twitter ', '200', 'newusers', '\nExpected Outcome: Boost in project visibility,stronger community bonding,and increased interest from new audiences.', 'The activity will start from the planning and will also involved me reaching out to all the intended speakers,the Business Developer (Tokideoracle)And the Chinese community,led by Mary.', 'It will be a twitter space and it\'s suppose to house more than hundred ambassadors both in Nigeria and abroad,50 newbies and other mutuals.', 'The following will speak at the meeting.\n\n1.Cryptogist\n2.Vctory Boy\n3.Ahmad\n4.TOKI\n\nAnd so many others', 'Smtm\nChimezie\nCampus exchange \n', 'I will will need a total $200 to do give away to boost the confidence of the newbies.\nITEM NEEDED\n-Giveaway=$200\n', 'I will need fliflop to send their representatives to speak in the meeting.Also I will need them to send their Business Developer(Tokideoracle).', 1, 'Thank you for your application. Weâ€™ve received your request, and our BD team will reach out to you via email shortly.\nPlease note: approval on the website only confirms that we have received your message. All details and next steps will be discussed directly with our BD team.\n', 0, '2025-09-24 19:18:10', '2025-09-26 07:47:18', 0, 'cryptogistextra@gmail.com'),
(1971225002623672321, 1970937806616305665, 'Danmasani55', '@babakarami90', '@isahH59089', '98xuA6GtLwGDqHHQVyJnay8pPgdcKRUT9NPi7yiBG2dp', 'Activity: Community members collaborate on projects like clean-ups, tree planting, or awareness campaigns.', 'Flipflop has the potential to connect with a global audience by leveraging digital platforms, social media, and community engagement. Through multilingual content, influencer partnerships, and global collaborations, it can expand visibility and accessibility.', 'online', '2025-09-24 02:03:00', 'Nigeria ', 'Good ', 'community', 'Build stronger relationships â€“ connecting with peers through shared challenges.\n', 'Facilitators guide, observe, and provide assistance to ensure fair participation.\n', '', '', '', 'To successfully implement the Flipflop activity and achieve its goals of engagement, awareness, and global reach, financial support is required.', 'Collaboration with influencers or ambassadors to promote the activity.\n', 2, 'Please provide a detailed plan to ensure that the BD team has a comprehensive understanding of your proposal before contacting you.', 0, '2025-09-25 14:47:19', '2025-09-26 06:54:26', 0, 'hisahdanladi@gmail.com'),
(1971527244421570562, 1970721348116348930, 'Johnbull ', '@CryptoJohnbullTG ', 'CryptoJohnbull', 'Fbehis95VK4Yvhm45Rujf2HTuNKLu4RQa1RC12qoKz2', 'FlipFlop: Fair Token Launches with Proof of Mint', 'I am a Web3 content creator, KOL, and ambassador with experience in community building and hosting offline blockchain events. I have collaborated with projects such as Sui, 1inch, Ston.fi, and Cambrian_AI, focusing on content creation, grassroots adoption, and student engagement. My strength lies in simplifying complex blockchain concepts into relatable stories that connect with communities. With FlipFlop, my aim is to organize impactful offline events that bring KOLs and Web3 communities together, creating awareness and building strong networks around its innovative model', 'offline', '2025-10-17 10:03:00', 'Uyo, Nigeria.', 'Offline Event', 'community', 'The goal of this activity is to introduce FlipFlop to key opinion leaders and Web3 communities through an engaging offline event. By combining educational sessions, interactive activities, and community incentives, the event will showcase FlipFlopâ€™s unique model, strengthen its brand presence, and build strong grassroots networks that can amplify awareness and adoption across broader ecosystems', 'The event process will begin with securing a suitable venue, preparing promotional materials, and coordinating with invited speakers. Promotion will target KOLs and Web3 communities through social media campaigns, online ads, and direct outreach to local community leaders. During the event, participants will be introduced to FlipFlop through keynote and speaker sessions, followed by interactive activities such as quizzes, discussions, and giveaways to encourage deeper engagement. Branded merchandise, food, and refreshments will be provided to enhance the experience, while photos and videos will be captured for recap content. After the event, highlights will be shared online, feedback collected from attendees, and a report presented to the FlipFlop team to ensure lasting impact and strengthened connections with KOLs and communities.', '120', 'Delf, Fidel and Johnson ', 'Phoenix Ecosystem and web3 Threshold ', 'ğŸ”¹ Itemized Budget Request\n\n1. Venue & Logistics â€“ $120\n\n2. Food & Refreshments â€“ $80\n\n3. Branding & Merchandise â€“ $200, this includes event branding (banners, posters, flyers swag for attendees stickers, T-shirts, tote bags.\n\n4. Advertising & Promotion â€“ $100\n\n5. Community Incentives â€“ $100\n\n6. $120  for invited speakers.', '1. Amplification through FlipFlopâ€™s official social channels, retweets/reposts of event announcements and recap content to expand reach.\n\n2. Branding Assets', 2, 'Thanks for your information, Please directly contact our BD Toki in Nigeria to further discuss the opportunity, X:@defitoki', 0, '2025-09-26 10:48:19', '2025-09-28 02:49:52', 0, 'johnbullonland@gmail.com'),
(1971531662646878209, 1970897754259496962, 'Watt', 'web3diviner ', 'Watt', 'G6uSZpwCjUCHrgfxh9pWqmAHuEawDArL38fDQTwG4BhN', 'Akure Flipflop Meet up ', 'I\'m Angel Akpan \nA 400L student of the Federal University of Technology Akure situated at Ondo State, Nigeria.\n\nI am passionate about web3 as a whole and Blockchains.\nI love creating opportunities for fellow team mates and sharing my ideas and knowledge.\n\nI am experienced in running outreaches and campaigns for different teams. This is something I love to do.', 'hybrid', '2025-10-24 08:00:00', 'Akure, Ondo State.', 'Campus based ', 'newusers', 'Onboarding to web3 and introducing Flipflop packages to new users.', '- Adverts and promotions\n- Online registrations\n- Event day \n(1. Welcome and introduction\n2. Theme Topic: Advancement in Web3 Technology and impact in economy \n3. Question and answers\n4. Games/short break \n5. What is Flipflop - Discussion\n6. Onboarding session \n7. Connect \n8. Launch\n9. Photographs\n10. Feedbacks)\n', '100+', 'Not yet finalized', '- The movement community \n- Red hat agency ', 'Target population: Â± 100 participants\n\nHall rentage - 50,000\nData (for streaming) - 5,000\nFeeding (Launch) - 200,000\nCustomized tags - 30,000(300 naira per person)\nDesigned surveniers/jotters - 100,000\nFuel - 10,000\nSound system rentage - 35,000\nLogistics - 50,000\nMiscellaneous - 20,000\n\nTotal: 500,000 naira ', 'Promotion', 2, 'Thanks for your information, Please directly contact our BD Toki in Nigeria to further discuss the opportunity, X:@defitoki', 0, '2025-09-26 11:05:52', '2025-09-28 02:49:49', 0, 'webdiviner25@gmail.com'),
(1971572159121760258, 1971564863448719361, 'Favour peters', 'Favourpeters ', '@phavvyking ', 'G52JYgDovaeX2eQ6mVKT69wxAR1BidUG2SWTXEaZ7uB3', 'Promotion', 'Fostering online communities & driving engagement in the decentralized space | Passionate about blockchain, innovation & collaboration\"', 'online', '2025-05-08 23:02:00', 'Nigeria', '10/10', 'community', '1. Foster a positive and respectful community environment\n2. Ensure discussions stay on topic and follow community guidelines\n3. Encourage engagement and participation from members\n4. Resolve conflicts and address concerns in a fair and timely manner\n5. Provide helpful guidance and support to community members\n6. Maintain a safe and inclusive space for all members\n\n', 'Moderator, Growth strategist Amb', 'Fostering growth and development in Web 3 Nigeria ', 'Speaker', 'Zealy', '1. Community Engagement ($100):\n    \n\n2. Content Review (80$)\n\n3. Conflict Resolution ($50):\n\n\n4. Community Maintenance ($30):\n    \n\n5. Reporting and Analytics ($40):\n\n\n300$ bill\n    -', 'Ads and Engagement ', 2, 'Thanks for your information, Please directly contact our BD Toki in Nigeria to further discuss the opportunity, X:@defitoki', 0, '2025-09-26 13:46:47', '2025-09-28 02:49:36', 0, 'Kingfaphavvy@gmail.com'),
