(1973025838718906370, 1970533870789001217, 'Khulture', '@JustlacyKimberleyRogers', '@khulture_d_mod', '2AquuebhKVvFTNvEDhjVGvpv87qD1eJdiia5aswZb2sc', 'WEB3 Unchained: Bridging Crypto and Creativity', 'Imagine a community where every artist, musician, and writer has the power to truly own their work, connect directly with their audience, and build a sustainable career without intermediaries. This isn\'t a distant dream; it\'s the future we want to build, right here, right now. \"Lagos Unchained\" is more than an event; it\'s a movement. It\'s a vibrant, hands-on celebration designed to demystify the world of Web3 and place its powerful tools directly into the hands of our city\'s most creative minds. We want to replace confusion with curiosity and barriers with bridges, creating a space where technology feels less like a code and more like a canvas for creation and showcasing of ideas.\n', 'hybrid', '2025-10-30 00:00:00', 'Co-creation Hub (CcHUB), 294 Herbert Macaulay Way, Yaba, Lagos, Nigeria. A vibrant and respected nexus for tech and innovation in the heart of Lagos.', '150 in-person attendees & 300+ online viewers.', 'newusers', 'Our goals are deeply human focused and centered on genuine empowerment:\nSpark Genuine Curiosity: To transform the intimidating perception of crypto into an exciting, accessible tool for at least 150 local creators. We want to see the \'aha!\' moment on their faces as they realize what\'s possible.\nEmpower Through Education: To personally guide 50+ new users through the entire process of setting up a Solana wallet and exploring the FlipFlop platform, ensuring they leave with confidence, not just information.\nBuild a Real Community: To plant the seeds of a lasting FlipFlop creator community in Lagos a support system that lives on long after the event, connecting, sharing, and growing together. Also  to spotlight 3-5 local artists who are already using Web3, providing tangible proof and heartfelt inspiration for what\'s possible when creativity meets technology.\n', 'We\'re creating an experience, not a lecture. Our agenda is designed for energy, connection, and hands-on learning:\n2:00 PM: Doors Open & \"Vibes\" - The event kicks off with a live Afrobeats DJ, welcome drinks, and an interactive art wall. We start with human connection.\n2:30 PM: \"What if...?\" - A passionate opening talk. No jargon. Just storytelling about the future of creativity and ownership to ignite the imagination.\n3:00 PM: \"Your First Step into Web3\" - A hands-on, guided workshop. We\'ll walk everyone through creating a wallet and introduce the FlipFlop platform. We will have \'community helpers\' roaming to ensure no one gets left behind.\n4:00 PM: Creator Spotlight - Inspiring, rapid-fire talks from local creators already winning in the Web3 space. Real stories from real people.\n4:45 PM: \"Ask Us Anything\" - A candid Q&A panel with speakers and a FlipFlop expert (we hope!).\n5:15 PM - 6:00 PM: Connect & Collaborate - More music, food, and dedicated networking time. This is where the community is truly forged.\nOnline Experience: We\'ll have a dedicated host for the livestream to engage the online audience, field their questions for the Q&A, and run online-exclusive polls and giveaways to make them feel part of the experience.\n', 'we\'re aiming for tangible impact:\nAttendance: 150+ engaged in-person attendees and 300+ unique online viewers.\nOnboarding: 75+ new Solana wallets created during our workshop.\nReach: Over 20,000 impressions on social media through our promotional campaign and the event hashtag #LagosUnchained.\nMedia Coverage: Features in at least two major Nigerian tech or culture blogs (e.g., TechCabal, BellaNaija).\nCommunity Growth: A new, active Telegram group for Lagos FlipFlop creators with at least 100 members by the end of the event, ready to support each other on their journey', 'We are in initial, hopeful conversations with Niyi Okeowo, a renowned Nigerian digital artist, and The Gidi Creative Centre, a local art incubator, to participate in our Creator Spotlight', 'We plan to partner with AfroTech Hub and the Lagos Art Collective to cross-promote the event and tap into their vibrant, creative communities.\n', 'To bring this vision to life with the energy and quality it deserves, we need your support. Our budget is built on creating an unforgettable experience, not extravagance.\nVenue & Logistics - $1,600: To secure a prime, tech-ready space at CcHUB. This is our foundation for a professional and inspiring atmosphere.\nTech & Streaming - $1,200: For professional audio-visual equipment and a multi-camera setup for a high-quality, engaging livestream. We want our online guests to feel like they\'re in the room with us.\nFood & Beverage - $800: Good food and drinks are the lifeblood of connection! This is for local caterers to provide refreshments that keep the energy and conversations flowing.\nMarketing & Promotion - $600: For targeted social media ads and collaborations with local influencers to ensure we reach every creator who needs to be in the room.\nCreator Showcase Stipend - $300: A small honorarium ($100 each for 3 creators) to value the time and talent of our local speakers. This is about investing back into the community from day one.\nTotal Request: $4,400 USDT\n', 'Beyond finances, a true partnership would be the dream. We would be incredibly grateful for:\nMarketing Amplification: A feature on FlipFlop\'s official Twitter/X and blog to lend us credibility and help us reach a global audience.\nExpert Presence: Having a FlipFlop team member join our Q&A panel remotely would be invaluable, providing direct insight and forging a stronger connection to the brand.\nAwesome Swag: Co-branded T-shirts, stickers, notebooks! It\'s amazing how much a cool piece of merchandise can make people feel like they\'re part of a family.\n', 2, 'Please contact our BD Toki directly from TG or X. Thanksï¼', 0, '2025-09-30 14:03:12', '2025-10-01 16:53:08', 0, 'agudabelieve@gmail.com'),
(1973448993249718273, 1970385125078298625, 'Freedom.sui', '@Freedom.sui ', '@678Respect', 'CNW4sT6PrdYiGcoLz4f7pemiZmFGHNt9YWVjvc49YH3T', 'Green and white ', 'Hey, Iâ€™m part of @ApexiumAgency. Weâ€™re offering projects a free 7-day promotion from apexium. If youâ€™re open, Iâ€™ll connect you directly with the Apex team.', 'online', '2025-10-02 00:00:00', 'Nigeria ', 'High ', 'newusers', 'â€œGet 1,000 daily users.â€\nâ€œKeep server response under 200ms.â€\nâ€œGrow signups by 20% this month.â€', 'Process â†’ Clean, filter, and organize the data.', 'With FlipFlopâ€™s support, we anticipate the following outcomes:\nAttendance & Participation\n\n\n500+ active community members engaged in events/activities.\n200+ consistent contributors (builders, testers, moderators).\nReach & Engagement\n50,000+ social media impressions across campaigns.\n5,000+ unique users interacting with the platform.\nGrowth of community channels by 30% within 3 months.\nMedia Coverage & Visibility\nFeatures in at least 5 reputable Web3/tech publications.\nCoverage by 10+ KOLs/influencers across Twitter & Telegram.\nBranded presence in newsletters, podcasts, and online panels.\nEcosystem Impact\nIncreased awareness of FlipFlopâ€™s role in supporting builders.\nStronger network effects as new users join and remain active.\nPositioning FlipFlop as a core driver of innovation in the space.', '@10X of web3 and @skyler and also boss @Toki the oracle ', '@big sensei ', 'Product Development & Technology\nSoftware tools, integrations & licenses â€“ $2,500\nBackend/server hosting & maintenance â€“ $1,800\nSecurity audits & quality assurance â€“ $1,200\nSubtotal: $5,500', 'Communication, show me how to really do things ', 2, '', 0, '2025-10-01 18:04:40', '2025-10-02 04:19:57', 0, 'Farukyousuf78@gmail.com'),
(1973475906487873538, 1973471978895470594, 'Awiggy', '@Awogor007', '@Prolific09017', 'BBoErKrLGnh3MEyg7a2EYCh58UCTuMiftk7ptGLsZNuH', 'What is flipflop and How can I get involved ', 'It will be a lively space, where all can explore Web3 trends, NFT drops, and the future of decentralized communities, all while tracking the real impact of our digital footprints. \n\nWe will entertain questions, ideas, and curiosity. ', 'online', '2025-10-15 00:00:00', 'Twitter ', '100+', 'community', 'We will be introducing Flipflop our local audience, aiming to  flip the script on how we think about NFTs and sustainability in Web3 ', 'The event will take place on the 15th of October, by 7pm WAT', '100+', '@Joshuaudo10', 'Howite crypto community ', 'The budget to get this done should be about $300\n\nThis is because rewards should be given to listeners who bring up meaningful contributions and giveaways to active listeners to boost participation ', 'Nil', 2, '', 0, '2025-10-01 19:51:36', '2025-10-02 04:19:41', 0, 'awogorashaba428@gmail.com'),
