(1974611523623989250, 1971466580290215937, 'Nazeey ', '@n1azee', 'Nazeey.sol ', 'GbzctWyDDL83ZKtH1PK1xY5byt8S7RvDy9heRkdpX5jw', 'Building Community Engagement Through FlipFlop Missions', 'This event will gather Web3 enthusiasts and FlipFlop supporters to discuss how to participate in FlipFlop PathPort activities, share strategies for community growth, and explore opportunities in decentralized travel and networking.\n', 'hybrid', '2025-10-16 00:00:00', 'Twitter ', '30 -50', 'newusers', 'To raise awareness about FlipFlop PathPort, onboard new members, and help the community understand how to earn rewards through participation.\n\n', '6:00 PM â€“ 6:10 PM: Welcome and Introduction of FlipFlop PathPort\n\n6:10 PM â€“ 6:30 PM: Keynote Talk â€” â€œHow FlipFlop PathPort Empowers Web3 Communitiesâ€\n\n6:30 PM â€“ 6:50 PM: Community Discussion: Sharing Experiences and Tips\n\n6:50 PM â€“ 7:00 PM: Q&A Session\n\n7:00 PM â€“ 7:10 PM: Closing Remarks and Announcement of Next Event\n', 'Estimated 40â€“60 participants (online)\n\n10K+ impressions on X (Twitter) through posts and tags\n\n5â€“10 active speakers or question participants\n\nCommunity photos and short recap video for social media promotion\n\n', '', 'Partnering with local Web3 and blockchain clubs in Kano to host and share the event.\n\n', 'Requesting $500 for promotional materials and online giveaways to encourage participation.\n\n$300 for social media ads\n\n$200  for small reward incentives\n\n', 'Need official FlipFlop retweet, event banner, and possible speaker from the FlipFlop team to join.\n\n\n', 0, NULL, 0, '2025-10-04 23:04:08', '2025-10-04 23:04:08', 0, 'nazeersalihu57@gmail.com'),
