(1974706178680172545, 1974700631495028738, 'Mr.KingX', 'OfficialMrKingX ', 'OxMrKingX ', '2HK6mRYS7vac3enwDe32aQfuN2kuwVhrSET2xGifQoyu', 'Web3 Community Growth & Engagement Contest', 'This community contest aims to grow and engage the Web3 audience through creative tasks, educational content, and on-chain challenges that promote awareness about decentralized technologies and partner projects.', 'online', '2025-10-08 00:00:00', 'Twitter ', 'Global (Open to all Web3 users)', 'community', 'Increase active Web3 users and community participation\n', '1. Announce contest rules and timeline on Twitter \n2. Participants complete social and creative tasks (tweets, threads, memes, etc.)\n3. Submissions reviewed by the organizing team\n4. Winners announced publicly, rewards distributed onchain\n5. Final summary post highlighting outcomes and user engagement metrics', '500+ active participants\n1,000+ social media mentions\nGrowth in verified Web3 followers\nStronger community partnerships and long-term engagement\n', 'Mr.KingX and selected Web3 community leaders', 'To be announced potential collaborations with active Web3 communities and project ambassadors.\n', 'Requesting small incentive funds ($200â€“$500 USDT) for reward distribution to top participants and content creators, plus possible ad/promotion support for campaign visibility.', 'Marketing amplification (retweets, community shoutouts), event visibility on FlipFlopâ€™s dashboard, and collaboration with partner KOLs', 0, NULL, 0, '2025-10-05 05:20:16', '2025-10-05 05:20:16', 0, 'officialmrkingx@gmail.com'),
(1974846320480890882, 1971168199747608577, 'Samuel kola', '@kolawoleoke', 'https://x.com/kolawole24570?s=21', '9TEiC8JZyL8Djjxw7oNFsRXU8thNzEcLSfzz4rTGddXm', 'Web3 Education and Community Engagementâ€ I aim to educate new users about Flipflopâ€™s mission and help grow an active community by sharing updates, hosting discussions, and creating educational content about decentralization and blockchain adoption.', 'Iâ€™m a Web3 enthusiast passionate about community building and blockchain education. I love exploring new decentralized projects and helping others understand them. Iâ€™m excited to support Flipflopâ€™s vision by creating awareness and growing the community.', 'online', '2025-10-05 00:00:00', 'Nigeria', 'Iâ€™ll promote Flipflop across international Web3 spaces, collaborating with other ambassadors and creating content for a global audience.', 'newusers', 'To educate more people about Flipflop and Web3 by sharing clear, engaging content that helps newcomers understand decentralization and its benefits.', 'I will plan weekly content focused on Flipflop updates and Web3 education.\nIâ€™ll share posts and discussions on Telegram and X to engage users.\nIâ€™ll interact with the community, answer questions, and gather feedback to improve engagement.\n', 'I expect to reach and engage 500â€“1,000 users monthly through social media content, community discussions, and online events. My goal is to increase Flipflopâ€™s visibility across Telegram and X, encourage consistent participation, and attract new members to the ecosystem. I also aim to gain social engagement and media mentions through collaborations and shared posts from other ambassadors and crypto KOLs.\n', 'I will serve as the main presenter during online sessions and discussions. I also plan to invite fellow ambassadors and active community members to join as guest speakers for collaborations and AMAs related to Flipflopâ€™s updates and Web3 education.', 'Partners (Community/KOL):\nI plan to collaborate with the Flip community, where I currently serve as an ambassador, to promote Flipflop initiatives and updates. Iâ€™ll also connect with other active Web3 groups on Telegram and X, and engage small KOLs and content creators in the crypto space to help expand Flipflopâ€™s reach and strengthen community awareness.\n', 'Iâ€™m requesting support to enhance my online ambassador activities for Flipflop.\n\nItemized Expenses (Monthly Estimate):\n	â€¢	Internet data & connectivity â€“ $25\n	â€¢	Content creation tools (Canva/CapCut) â€“ $15\n	â€¢	Social media promotions â€“ $20\n	â€¢	Community reward incentives â€“ $30\n	â€¢	Online event hosting (Twitter Space/AMA) â€“ $10\n\nTotal: $100 (â‰ˆ â‚¦150,000)\n\nThis support will help me stay consistent online, create quality content, grow engagement, and expand Flipflopâ€™s awareness across digital platforms.', 'Iâ€™d appreciate mentorship, guidance, and access to Flipflopâ€™s latest updates and materials to help me create accurate and engaging content. Support with community management tools, promotional resources, and collaboration opportunities with other ambassadors would also help improve my impact and reach.\n', 0, NULL, 0, '2025-10-05 14:37:08', '2025-10-05 14:37:08', 0, 'kolawoleoke670@gmail.com'),
(1974901031376531458, 1974616820392407042, 'fennalvin', '@fennalvin01', '@fennalvin', '27XKSz3XRWLeuf5nZ2bgdJHhQ8aKSVWn4JHRGj9GAoyW', 'Activating Our Next hundred Leaders', 'A strategic effort to expand the FlipFlop PathPort\'s reach across non users. The activity would involves an online meet up to introduce new members, and consolidate support for the broader movement goals.', 'online', '2025-10-07 00:00:00', 'X (Twitter) / Nigeria', 'Estimated 100 participants', 'newusers', 'I hope to climb higher with flip flop by supporting the every movement, specifically by establishing two new local chapters and increasing active membership to a higher stand before the end of the year.', 'Promoting FlipFlop vision and mission on twitter posts', 'Hundreds of people', '', '10th clan', 'Stipend for a specialized contract role (e.g., graphic designer, data analyst) for promoting FlipFlop.', 'A modest logistical grant of $300 grant to cover basic digital conferencing fees and local communication costs.', 0, NULL, 0, '2025-10-05 18:14:32', '2025-10-05 18:14:32', 0, 'obukowhoalvin@gmail.com'),
(1975363389764939777, 1971215412037197826, 'Destiny ', '@phantomalp', 'Phantomalp9 ', 'FA9scSmfCJv2Axj42cHWDeeVJuAo9frKe5E99EprxJua', 'Exploring Web3: Learn, Earn, and Build in the Web 3 Space', 'This session will introduce beginners to the world of Web3.\nBreaking down complex terms, explaining how decentralized platforms work, and showing real opportunities for participation and earning. \nUsing the FlipFlop ecosystem as an example, weâ€™ll guide attendees through joining, verifying, and engaging meaningfully in Web3 communities', 'online', '2025-10-17 00:00:00', 'Twitter Space (Hosted by @Phantomalp9)', '30â€“50 participants (expected)', 'newusers', 'To educate newcomers on the fundamentals of Web3 while helping them discover accessible entry points into decentralized communities like FlipFlop. \nThe goal is to reduce confusion, onboard new members, and inspire active participation within the ecosystem', 'â€¢ Introduction : Welcome and overview\nâ€¢ Segment 1 : What is Web3 and why it matters\nâ€¢ Segment 2 : Ways to earn and contribute in Web3 ecosystems\nâ€¢ Segment 3 : Practical example , exploring FlipFlopâ€™s approach\nâ€¢ Q&A : Audience interaction\nâ€¢ Closing : Recap and call-to-action', 'â€¢ 40â€“60 live listeners\nâ€¢ 250+ impressions from post-event content\nâ€¢ 15â€“20 new FlipFlop community members onboarded\nâ€¢ Stronger awareness and credibility for FlipFlop among Web3 newcomers', 'â€¢ Destiny (Host and Organizer)\nâ€¢ Optional guest from FlipFlop or Web3 community', 'The Arena Community', 'Yes â€” $80 equivalent in USDT/SOL\nBreakdown:\n$40 â€” Giveaway rewards for engagement\n$25 â€” Promotional visuals and outreach\n$15 â€” Data/coordination support', 'â€¢ Event amplification through official channels\nâ€¢ Educational resources to support discussion\nâ€¢ Optionally, participation of a FlipFlop BD or representative', 0, NULL, 0, '2025-10-07 00:51:47', '2025-10-07 00:51:47', 0, 'destinyeni48@gmail.com'),
(1975364985810857986, 1971215412037197826, 'Phantom9', '@phantomalp', 'Phantomalp9 ', 'FA9scSmfCJv2Axj42cHWDeeVJuAo9frKe5E99EprxJua', 'Exploring Web3: Learn, Earn, and Build in the Web 3 Space ', 'This session will introduce beginners to the world of Web3.\nBreaking down complex terms, explaining how decentralized platforms work, and showing real opportunities for participation and earning. \nUsing the FlipFlop ecosystem as an example, weâ€™ll guide attendees through joining, verifying, and engaging meaningfully in Web3 communities.', 'online', '2025-10-17 00:00:00', 'Twitter Space (Hosted by @Phantomalp9)', '30â€“50 participants (expected)', 'newusers', 'To educate newcomers on the fundamentals of Web3 while helping them discover accessible entry points into decentralized communities like FlipFlop. \nThe goal is to reduce confusion, onboard new members, and inspire active participation within the ecosystem. ', 'â€¢ Introduction : Welcome and overview\nâ€¢ Segment 1 : What is Web3 and why it matters\nâ€¢ Segment 2 : Ways to earn and contribute in Web3 ecosystems\nâ€¢ Segment 3 : Practical example, exploring FlipFlopâ€™s approach\nâ€¢ Q&A : Audience interaction\nâ€¢ Closing : Recap and call-to-action', 'â€¢ 40â€“60 live listeners\nâ€¢ 250+ impressions from post-event content\nâ€¢ 15â€“20 new FlipFlop community members onboarded\nâ€¢ Stronger awareness and credibility for FlipFlop among Web3 newcomers', 'â€¢ Destiny (Host and Organizer)\nâ€¢ Optional guest from FlipFlop or Web3 community', 'The Arena Community', 'Yes \n\n$80 equivalent in USDT/SOL\nBreakdown:\n$40 â€” Giveaway rewards for engagement\n\n$25 â€” Promotional visuals and outreach\n\n$15 â€” Data/coordination support', 'â€¢ Event amplification through official channels\nâ€¢ Educational resources to support discussion\nâ€¢ Optionally, participation of a FlipFlop BD or representative', 0, NULL, 0, '2025-10-07 00:58:08', '2025-10-07 00:58:08', 0, 'destinyeni48@gmail.com'),
(1975522952686350337, 1973646688010661889, 'DinkyFundz ', '@DinkyFundz', '@CharlesDin1521', 'GdUNj7Z1rVyJvrA4zKQerTb3PnMPVmH3GKdr2dyLN79Y', 'IRL summit event to sensitize people on flip flop platform ', 'This will be the first ever offline summit event in calabar for Flipflop. It\'ll help bring more sensitization to the people in Calabar, Nigeria who do not know about this project.\n\nThe goal is also is to host this events every 2months or monthly, depending on the support and permission from the project team', 'offline', '2025-10-18 00:00:00', 'Calabar, Nigeria ', 'An opportunity worth giving a trial. It could bring maximum engagement and visibility ', 'newusers', 'Onboard more community members, and create more awareness. ', 'Create an AMA session with buzz about the event date, post several fliers for countdown days, get the necessary requirements and hold a smooth event summit that will entertaining, fun, impactful, educating and profitable to the team.\n\nI\'m speaking confidently out of experience from the summits I\'ve handled so far. Proof on my x page ', 'Expected attendance of 50-70 persons for a start. A wider reach on X, Telegram, Tiktok etc through community posts, buzz and engagements. ', 'Myself (@CharlesDin1521)\n@Yesh04, @Prolific, @Itohowo etc. ', 'HOWITE CRYPTO MARKETING COMMUNITY, headed by me.\nKOL manager - @Yesh04', 'Costing from my previous summit for Xendfinance, I\'d need up to $800 in total.\n\nThe budget is;\n1. Event hall rental - $150 - $200\n2. Purchase and branding of T-shirts - $8 each (20pcs) for my team, coworkers and giveaway to the new users - $190\n3. Roll-up stand, flex banner, flier designs etc - $120\n4. Transportation and logistics - $30\n5. Refreshments - $150\n6. PowerPoint slideshow designs for lecture guide/Projector - $30.\n7. Media coverage and clips - $50', 'Publicity for the event summit once or twice before the event date and another after the event to show full support from the Flipflop team.', 0, NULL, 0, '2025-1