(1971517327270780930, 1971510083854573569, 'Web3 with Evidence ', 'dev.evidence1777@gmail.com', 'EmmanuelOy42865', '@Emma1_777', 'EMxdLHJdj9NHmWy3nKUq7w7BdSqNpViA6gWbmgA1ENrM', 'creator,researcher,student', 'content,research', 'https://x.com/EmmanuelOy42865/status/1968592919641657804\n\nhttps://x.com/EmmanuelOy42865/status/1965676065906639150\n\nhttps://x.com/EmmanuelOy42865/status/1965420323148284004\n\nhttps://x.com/EmmanuelOy42865/status/1967587719984427338\n', 'As someone  involved in Web3 development and AI research\n\nI\'m really excited about what FlipFlop is doing using Bitcoin\'s ideas but Building on Solana is smart. I\'ve seen how unfair most token launches are, where only big players or bots win. FlipFlop\'s Proof of Mint system actually gives everyone a fair chance, which is what crypto should be about.\nAs someone who builds with AI and works in DeFi, I can help FlipFlop grow by explaining how their system works to regular people. I want to be part of something that\'s actually solving real problems in crypto launches, not just another project making promises.\n The AI part is especially interesting to me because it can make launches even more fair and automated.', '3hour/day 15hours/week', 'yes', 'I\'m active on X (@EmmanuelOy42865) where I talk about Web3 stuff, AI projects, and DeFi regularly. I have good connections with other developers and crypto people who trust my opinions.I can help FlipFlop by writing guides that make sense to people, joining community calls to answer questions, and getting my network interested in what FlipFlop is building. I\'m good at breaking down complicated things so regular people can understand them.', 'I\'m still learning about tokenomics and how to build strong communities, so I\'d really appreciate guidance from experienced people in the FlipFlop team. I know my tech aspect well, but I want to get better at the business and community side.', 1, '', 0, '2025-09-26 10:08:54', '2025-10-01 12:19:29', 0),
