(1975226682570715138, 1975224357009502210, 'jhoel', 'jhozzyeddy7@gmail.com', '@jhoeleth', '@jhoeleth', 'YNERwjY7SSvDpNyyp7Yqye9B8M6WX2siXEPYF7WCoad', 'creator,kol,enthusiast', 'content,community,research', 'https://x.com/jhoeleth/status/1731226288780894506\nhttps://x.com/jhoeleth/status/1629042872115658755\n', 'Iâ€™ve been working in Web3 for about four years, helping projects grow through content creation, community building, and influencer marketing.\n\nIâ€™ve worked with projects like NFTrade, Coinstore, Manta Network, Orderly Network, BTS Global, and more, driving 30â€“50% growth in engagement, boosting active participation, and attracting new users to their ecosystems.\nI achieve this by breaking down complex topics and creating content that resonates with real people.\n\nIâ€™m passionate about FootPrint because it gives power back to users and opens up new opportunities. Thatâ€™s why I love supporting projects that are building real solutions. \nAs an ambassador, I bring experience, creativity, and consistency, with a focus on growth and long-term community value.\n\nCurrently, I work with Whitebit (the crypto exchange partnered with Barcelona) and serve as a KOL of Multiple Network, and FanTv.\n\nBeyond content, Iâ€™ve hosted AMAs, supported token listings, and strengthened community trust, Iâ€™m always focused on results and long-term impact.', '20hrs/week', 'yes', 'Yes', 'Yes of course. ', 1, '', 0, '2025-10-06 15:48:34', '2025-10-08 02:51:02', 0),
